import { FunctionComponent } from "react";
import styled from "styled-components";
import { HoverOutline } from "../../../mixins/mixins";
import { theme } from "../../../styles/theme/theme";

import SearchInput from "./search-input";
import OrderInput from "./order-select";

const Container = styled.div`
  width: 100%;
  height: max-content;

  display: flex;
  align-items: center;
  justify-content: space-between;
`;

const SearchContainer = styled.div`
  width: 40%;

  border: solid 1px ${theme.colors.border.main};
  border-radius: 15px;

  display: flex;
  align-items: center;
  justify-content: space-between;

  //prettier-ignore
  padding:  ${theme.spacing.space.small};

  margin-bottom: ${theme.spacing.space.xxxlage};

  ${HoverOutline}
`;

const SearchBox: FunctionComponent = () => {
  return (
    <Container>
      <SearchContainer>
        <SearchInput />
      </SearchContainer>
      <OrderInput />
    </Container>
  );
};

export default SearchBox;
